import React, { Component } from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import "./App.scss";
// import Chatbotbody from "./components/Chatbot-body";
import Monthselection from "./components/Month-selector";
import Entries from "./components/Entry-selection";
import Navbar from "./components/Navbar";
// import { BrowserRouter } from "react-router-dom";
/* monthdata === [{
name : "Cycle 2" , additionalInfo: [{
name: "Abhijeet Acharaya" , price : 1200, addressLine1: "dsdsdsdd", addressLine2: "dsdsdsdd"}, {
name: "Abhijeet Acharaya" , price : 1200, addressLine1: "dsdsdsdd", addressLine2: "dsdsdsdd"}]}, {
name : "Cycle 1" , additionalInfo: [{
name: "Double Dhamaka" , price : 1200, typeofpurchase: "life boaster"}]}] */
class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <Switch>
          <div className="App">
            {/* <Chatbotbody /> */}
            <Navbar />
            <Route path="/" exact>
              <Monthselection
                Months={[
                  {
                    Rendermonth: "September 2020",
                  },
                  {
                    Rendermonth: "August 2020",
                  },
                  {
                    Rendermonth: "July 2020",
                  },
                  {
                    Rendermonth: "June 2020",
                  },
                  {
                    Rendermonth: "May 2020",
                  },
                  {
                    Rendermonth: "April 2020",
                  },
                  {
                    Rendermonth: "March 2020",
                  },
                ]}
              />
            </Route>
            <Route path="/Entry-selection" exact>
              <Entries
                entries={[
                  {
                    entryHeading: "Cycle 2",
                    dateRange: "16 Sep - 30 Sep",
                    userEntries: [
                      {
                        userName: "Abhijeet Acharya",
                        price: "1200",
                        additionalInfo: "MH/2222483703",
                        dateIssue: "Issued on 12 Dec - 2020",
                      },
                      {
                        userName: "Abhijeet Acharya",
                        price: "1200",
                        additionalInfo: "MH/2222483703",
                        dateIssue: "Issued on 12 Dec - 2020",
                      },
                    ],
                  },
                ]}
              />
            </Route>
          </div>
        </Switch>
      </BrowserRouter>
    );
  }
}

export default App;
